def solve_rebus(rebus_str: str, n: int) -> (str, str):
    s = rebus_str.split('=')
    v = n
    qs = s[0].split()
    pos = 1
    neg = 0
    signs = []
    if len(qs) > 0:
        pos += 1
    for i in qs:
        if i == '+':
            pos += 1
            signs.append(1)
        elif i == '-':
            neg += 1
            signs.append(0)
    if pos == 0 and neg == 0 and (v == 0):
        return ('Possible', '= 0')
    elif pos == 0 and neg == 0 or pos * v - neg < v or pos - neg * v > v:
        return ('Impossible', '')
    else:
        result = 'Possible'
        t = pos - neg
        solution = f'{1 + max(0, min(v - 1, v - t))} '
        t += max(0, min(v - 1, v - t))
        for i in signs:
            if i == 0:
                solution += '- '
                solution += f'{1 + max(0, min(v - 1, t - v))} '
                t -= max(0, min(v - 1, t - v))
            if i == 1:
                solution += '+ '
                solution += f'{1 + max(0, min(v - 1, v - t))} '
                t += max(0, min(v - 1, v - t))
        solution += f'= {v}'
        return (result, solution)

